import React from "react";
import './Home.css';
import Chatbot from "../pages/chatbot";
import { Link } from "react-router-dom";

const Navbar = ()=> {
<header className="header">
<div className="logo">
  <img src="/home/prasannkhamkar79/Projects/hackathon/npc_hackathon/public/agro-buddy-icon.jpeg" alt="Agro" />
  <h1>AGRO BUDDY</h1>
</div>
<nav className="nav">
  <button>Check Soil Compatibility</button>
  <Link to="Chatbot"><button className="chatbot">Chatbot</button></Link>
  <button>Check Crop Compatibility</button>
  <button>Weather Forecast</button>
  <button>Contact & Support</button>
</nav>
</header>
};
export default Navbar;
